import { Link } from 'react-router-dom';
import './'
const ProductCard = ({ product }) => {
    return (
        <Link to={`/product/${product.id}`}>
            <div className='product-card'>
                <img src={product.image} alt={product.name} />
                <h2>{product.name}</h2>
                <p>{product.category}</p>
                <p>${product.price}</p>
            </div>
        </Link>
    );
};

export default ProductCard;
